import React from 'react';
import Header from '../components/header'; // Asegúrate de que esta ruta es correcta
import ProductCard from '../components/productcard'; // Asegúrate de que esta ruta es correcta
import { useSelector } from 'react-redux'; // Si usas Redux, verifica su uso

const ProductListPage = () => {
  // Puedes reemplazar los datos de ejemplo con los datos reales del estado de Redux
  const products = useSelector(state => state.products) || [
    { id: 1, name: 'Plant A', price: 10, image: 'path/to/imageA.jpg', category: 'Indoor' },
    { id: 2, name: 'Plant B', price: 15, image: 'path/to/imageB.jpg', category: 'Outdoor' },
    { id: 3, name: 'Plant C', price: 20, image: 'path/to/imageC.jpg', category: 'Succulent' },
    // Añadir más productos
  ];

  return (
    <div>
      <Header />
      <h2>Product List</h2>
      <div className="product-list">
        {products.map(product => (
          <ProductCard key={product.id} product={product} />
        ))}
      </div>
    </div>
  );
};

export default ProductListPage;
